/* ~~~ STUFF IM TOO LAZY TO NAME ~~~ */
function blob817(url817) {
  const parts817 = url817.split(',');
  const mime817 = parts817[0].match(/:(.*?);/)[1];
  const binary817 = atob(parts817[1]);
  const array817 = new Uint8Array(binary817.length);
  for (let i = 0; i < binary817.length; i++) {
    array817[i] = binary817.charCodeAt(i);
  }
  return new Blob([array817], { type: mime817 });
}
